import React from "react";
import "./footer.scss";

const Footer = () => (
  <footer className="footer">
    <div className="icons">
      <i class="fab fa-facebook"></i>
      <i class="fab fa-twitter"></i>
      <i class="fab fa-youtube"></i>
    </div>
  </footer>
);

export default Footer;
